    data: |
      SELECT col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + - col2 - + 60 + - 13 BETWEEN ( + - col0 ) AND + 67;
  - name: tab2

outputs:
  - name: q11809.out
    data: |
      23
      40
      58
